problem:
In triangle $ABC,$ $E$ lies on $\overline{AC}$ such that $AE:EC = 2:1,$ and $F$ lies on $\overline{AB}$ such that $AF:FB = 1:4.$  Let $P$ be the intersection of $\overline{BE}$ and $\overline{CF}.$

[asy]
unitsize(0.8 cm);

pair A, B, C, D, E, F, P;

A = (1,4);
B = (0,0);
C = (6,0);
E = interp(A,C,2/3);
F = interp(A,B,1/5);
P = extension(B,E,C,F);

draw(A--B--C--cycle);
draw(B--E);
draw(C--F);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$E$", E, NE);
label("$F$", F, W);
label("$P$", P, S);
[/asy]

Then
\[\overrightarrow{P} = x \overrightarrow{A} + y \overrightarrow{B} + z \overrightarrow{C},\]where $x,$ $y,$ and $z$ are constants such that $x + y + z = 1.$  Enter the ordered triple $(x,y,z).$

Below is a portion of the graph of a function, $y=h(x)$:

[asy]
import graph; size(8cm); real lsf=0.5; pen dps=linewidth(0.7)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-4.25,xmax=4.25,ymin=-7.25,ymax=6.25;

pen cqcqcq=rgb(0.75,0.75,0.75);

/*grid*/ pen gs=linewidth(0.7)+cqcqcq+linetype("2 2"); real gx=1,gy=1;
for(real i=ceil(xmin/gx)*gx;i<=floor(xmax/gx)*gx;i+=gx) draw((i,ymin)--(i,ymax),gs); for(real i=ceil(ymin/gy)*gy;i<=floor(ymax/gy)*gy;i+=gy) draw((xmin,i)--(xmax,i),gs);

Label laxis; laxis.p=fontsize(10);

xaxis("",xmin,xmax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true); yaxis("",ymin,ymax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true);
real f1(real x){return 4.125-(x+0.5)^2/2;}
draw(graph(f1,-4.25,4.25),linewidth(1));
clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);
label("$y=h(x)$",(4.5,-6),E);
[/asy]

If the graph of $y=h(x-3)$ is drawn on the same set of axes as the graph above, then the two graphs intersect at one point. What is the sum of the coordinates of that point?

highlighted_diff:
  We want to find the values of $x$ such that both $2x$ and $3x$ are in the interval $(1,2)$.  This means we need to find the values of $x$ that satisfy the following two inequalities:

\begin{align*}
1<2x<2\\
1<3x<2
\end{align*}

To find the values of $x$ that satisfy these inequalities, we can divide each of them by 2 and 3 respectively:

\begin{align*}
\frac{1}{2}<x<1\\
\frac{1}{3}<x<\frac{2}{3}
\end{align*}

Now,<span style='background-color: yellow;'> we need to find the values of $x$ that satisfy both of these inequalities.  This means we need to find the intersection of the two intervals.  The intersection of the two intervals is the interval that is contained in both intervals.

The interval $\left(\frac{1}{2},1\right</span>)$ is contained in the interval $\left(\frac{1}{3},\frac{2}{3}\right)$, so the intersection of the two intervals is $\left(\frac{1}{2},1\right)$.

Therefore, the interval of all $x$ such that both $2x$ and $3x$ are in the interval $(1,2)$ is $\boxed{\left(\frac{1}{2},1\right)}$.<|eot_id|><|start_header_id|>user<|end_header_id|>

