problem:
Twenty-four 4-inch wide square posts are evenly spaced with 5 feet between adjacent posts to enclose a square field, as shown. What is the outer perimeter, in feet, of the fence? Express your answer as a mixed number. [asy]
unitsize(2mm);
defaultpen(linewidth(.7pt));
dotfactor=3;

path[] todraw = (1,9)--(9,9)--(9,1) ^^ (8,9)--(8,8)--(9,8) ^^ (5,9)--(5,8)--(6,8)--(6,9) ^^ (9,5)--(8,5)--(8,6)--(9,6) ^^ (8,8.5)--(6,8.5) ^^ (8.5,8)--(8.5,6) ^^ (5,8.5)--(4,8.5) ^^ (8.5,5)--(8.5,4);
path[] tofill = Circle((1.3,8.5),.15) ^^ Circle((2.1,8.5),.15) ^^ Circle((2.9,8.5),.15) ^^ Circle((8.5,1.3),.15) ^^ Circle((8.5,2.1),.15) ^^ Circle((8.5,2.9),.15);

for(int i = 0; i < 4; ++i)
{
draw(rotate(90*i)*todraw);
fill(rotate(90*i)*tofill);
}
[/asy]

A projectile is fired with an initial velocity of $v$ at an angle of $\theta$ from the ground.  Then its trajectory can modeled by the parametric equations
\begin{align*}
x &= vt \cos \theta, \\
y &= vt \sin \theta - \frac{1}{2} gt^2,
\end{align*}where $t$ denotes time and $g$ denotes acceleration due to gravity, forming a parabolic arch.

Suppose $v$ is held constant, but $\theta$ is allowed to vary, over $0^\circ \le \theta \le 180^\circ.$  The highest point of each parabolic arch is plotted.  (Several examples are shown below.)  As $\theta$ varies, the highest points of the arches trace a closed curve.  The area of this closed curve can be expressed in the form
\[c \cdot \frac{v^4}{g^2}.\]Find $c.$

[asy]
unitsize (5 cm);

real g, t, theta, v;
path arch;

g = 1;
v = 1;

theta = 80;
arch = (0,0);

for (t = 0; t <= 2*v*Sin(theta)/g; t = t + 0.01) {
  arch = arch--(v*t*Cos(theta),v*t*Sin(theta) - 1/2*g*t^2);
}

draw(arch);
t = v*Sin(theta)/g;
dot((v*t*Cos(theta),v*t*Sin(theta) - 1/2*g*t^2),red);

theta = 40;
arch = (0,0);

for (t = 0; t <= 2*v*Sin(theta)/g; t = t + 0.01) {
  arch = arch--(v*t*Cos(theta),v*t*Sin(theta) - 1/2*g*t^2);
}

draw(arch);
t = v*Sin(theta)/g;
dot((v*t*Cos(theta),v*t*Sin(theta) - 1/2*g*t^2),red);

theta = 110;
arch = (0,0);

for (t = 0; t <= 2*v*Sin(theta)/g; t = t + 0.01) {
  arch = arch--(v*t*Cos(theta),v*t*Sin(theta) - 1/2*g*t^2);
}

draw(arch);
t = v*Sin(theta)/g;
dot((v*t*Cos(theta),v*t*Sin(theta) - 1/2*g*t^2),red);

draw((-0.8,0)--(1.2,0));

dot((0,0));
[/asy]

